import React from 'react';
import './Table.css';

function Table() {
  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
  const hours = ['Hour 1', 'Hour 2', 'Hour 3', 'Break', 'Hour 4', 'Lunch', 'Hour 5', 'Hour 6', 'Hour 7'];
  const timeSlots = [
    '8:40 AM - 9:35 AM',
    '9:35 AM - 10:30 AM',
    '10:30 AM - 11:25 AM',
    '11:25 AM - 11:45 AM', // Break
    '11:45 AM - 12:40 PM', // Hour 4
    '12:40 PM - 12:55 PM', // Lunch
    '12:55 PM - 1:40 PM',  // Hour 5
    '1:40 PM - 2:30 PM',   // Hour 6
    '2:30 PM - 3:20 PM',   // Hour 7
  ];

  return (
    <div>
      <div className="college-timetable">
        <table>
          <thead>
            <tr>
              <th>Time</th>
              {daysOfWeek.map((day, dayIndex) => (
                <th key={dayIndex}>{day}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {hours.map((hour, hourIndex) => (
              <tr key={hourIndex}>
                <td>{hour}</td>
                {daysOfWeek.map((day, dayIndex) => (
                  <td key={dayIndex}></td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Table;
